%%
%[text] ## Approximation Accuracy for Each Alpha

% This section evaluates the approximation accuracy for different alpha values
% where wc equals w at each instant

% Define alpha range
alpha_values = 0:0.05:1;  % Alpha from 0 to 1 with step of 0.05
beta = 0;  % Fixed beta value

% Frequency range
points_in_range = 1000; %[output:4bb4fb0d]
range = logspace(-2, 6, points_in_range);
w = range;
wc = range;
s_vals = 1j * w;

% Initialize matrices to store errors
rel_err_mag_fo_alpha = nan(numel(wc), numel(alpha_values), numel(w));
rel_err_mag_so_alpha = nan(numel(wc), numel(alpha_values), numel(w));
rel_err_phase_fo_alpha = nan(numel(wc), numel(alpha_values), numel(w));
rel_err_phase_so_alpha = nan(numel(wc), numel(alpha_values), numel(w));


% Loop through each center frequency
for wc_idx = 1:numel(wc)
	% Loop through each alpha value
	for alpha_idx = 1:numel(alpha_values)
		alpha = alpha_values(alpha_idx);

		% For each frequency point, set wc = w
		for w_idx = 1:numel(w)
			wc_current = wc(wc_idx);
			s = s_vals(w_idx);

			% Calculate ideal fractional order response
			exponent = -(alpha + beta*1j);
			H_fractional = (s./wc_current)^exponent;

			% First Order Approximation (FOA)
			H_FO = 1 ./ FOA(s, alpha, wc_current);

			% Second Order Approximation (SOA)
			H_SO = 1 ./ SOA(s, alpha, wc_current);

			% Calculate magnitude errors
			mag_fractional = abs(H_fractional);
			mag_FO = abs(H_FO);
			mag_SO = abs(H_SO);

			rel_err_mag_fo_alpha(wc_idx, alpha_idx, w_idx) = abs(mag_FO - mag_fractional) ./ mag_fractional;
			rel_err_mag_so_alpha(wc_idx, alpha_idx, w_idx) = abs(mag_SO - mag_fractional) ./ mag_fractional;

			% Calculate phase errors
			phase_fractional = angle(H_fractional);
			phase_FO = angle(H_FO);
			phase_SO = angle(H_SO);

			rel_err_phase_fo_alpha(wc_idx, alpha_idx, w_idx) = abs(phase_FO - phase_fractional) ./ abs(phase_fractional);
			rel_err_phase_so_alpha(wc_idx, alpha_idx, w_idx) = abs(phase_SO - phase_fractional) ./ abs(phase_fractional);
		end
	end
end

